import "./App.css";
import "./index.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import PriceCalculator from "./pages/PriceCalculator";
import PriceCalculator1 from "./pages/PriceCalculator1";
import PriceCalculator2 from "./pages/PriceCalculator2";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
      <Route path="/" element = {<Home />} />
      <Route path="/price-calculator" element={<PriceCalculator />} />
      <Route path="/price-calculator1" element={<PriceCalculator1 />} />
      <Route path="/price-calculator2" element={<PriceCalculator2 />} />
      </Routes>
      </Router>
    </div>
  );
}

export default App;
